import React from 'react';

import Password from '../C_login/Password';
import Email from '../C_login/Email';
import LoginButton from '../C_login/LoginButton';

function CredentialLogin() {
  
  return (    
    <div class="credential_login">            
      <Email />
      <Password />
      <LoginButton />
    </div>
  );
}

export default CredentialLogin;
